import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const Navigation = () => {
  const [authenticated, setAuthenticated] = useState(false);

  // Function to handle logout
  const handleLogout = () => {
    // Perform logout logic here (e.g., clear tokens, reset state, etc.)
    // For now, we just set the authenticated state to false as a simple example
    setAuthenticated(false);
  };

  return (
    <nav className="flex justify-between items-center mb-4">
      <Link to="/">
        <img className="w-24 logo" src="/images/logo.png" alt=""/>
      </Link>
      <ul className="flex space-x-6 mr-6 text-lg">

            <li>
              <span>Welcome </span>
            </li>
            <li>
              <Link to="/listings/manage" className="hover:text-laravel">
                <i className="fa-solid fa-gear"></i>
                Manage Listings
              </Link>
            </li>
            <li>
              <button onClick={handleLogout}>
                <i className="fa-solid fa-door-closed"></i>Logout
              </button>
            </li>

            <li>
              <Link to="/register" className="hover:text-laravel">
                <i className="fa-solid fa-user-plus"></i> Register
              </Link>
            </li>
            <li>
              <Link to="/login" className="hover:text-laravel">
                <i className="fa-solid fa-arrow-right-to-bracket"></i>
                Login
              </Link>
            </li>


      </ul>
    </nav>
  );
};

export default Navigation;
